package ru.levkopo.barsik.emu.modulators

import DSP.SignalMsgHelper
import DSP.iq
import androidx.compose.runtime.Composable
import kotlinx.coroutines.delay
import org.jacorb.orb.CDRInputStream
import ru.levkopo.barsik.emu.modulators.base.BaseModulator
import java.util.Random

/**
 * Модулятор сигналов из заготовленых CORBA сообщений
 */
class SampleModulator: BaseModulator() {
    private val random = Random()
    private val sampleSignals = arrayOf(
        "",
        "",
        "",
    ).map {
        SignalMsgHelper.read(
            CDRInputStream(
                it
                    .chunked(2)
                    .map { it.toInt(16).toByte() }
                    .toByteArray()
            ).apply {
                setLittleEndian(true)
            }
        )
    }

    override suspend fun run() {
        while (isRunning.value) {
            currentIQ = sampleSignals[random.nextInt(sampleSignals.size-1)].extended.c
            delay(5000)
        }
    }

    @Composable
    override fun SettingsScreen() {

    }
}